  React.useEffect(() => {
    axios
      .get(`${process.env.REACT_APP_API_URL}/question/${questionId}/answers`)
      .then((response) => {
        setAnswer(response.data);
      });
  }, []);

  if (!answers) return null;
  return (
    <div>
      {answers.map((answer) => (
        <button>{answer.body}</button>
      ))}
    </div>
  );
}
